const HeaderStyles = (theme) => ({
  appBar: {
    boxShadow: "none",
    borderBottom: "1px solid #EEEEF0",
    padding: "0 3.125rem",
  },
  drawerHeader: {
    display: "flex",
    flexDirection: "row",
  },
  toolbar: {
    minHeight: "56px",
  },
});
export default HeaderStyles;
